import Head from "next/head";
import React from 'react'
import TasksList from '../components/TasksList'
import AddTask from '../components/AddTask'

export default class Home extends React.Component {
    render() {
        return (
            <>
                <Head>
                    <title>Home</title>
                </Head>
                <TasksList/>
                <AddTask />
            </>
        );
    }
}
